  \"Environmental Assessment for opening portions of Patoka River National Wildlife
  Refuge and Management Area for hunting and fishing as proposed in the 1996 Hunting
  and Fishing Plan\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T22:24:39.682909\",\n\t\"name\": \"environmental-assessment-for-opening-portions-of-patoka-river-national-wildlife-refuge-and\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Fish and Wildlife Service proposes
  to open portions of the Patoka River National Wildlife Refuge and Management Area
  (Refuge) for hunting (migratory birds, white-tailed deer and a variety of upland
  game) and sport fishing. This proposal is being made so that the Refuge can comply
  with its major objectives regarding habitat restoration and outdoor recreation opportunities.
  Alternatives considered in this proposal include: A) No action (no hunting or fishing);
  B) Opening select areas to hunting and fishing as deemed appropriate by Refuge staff
  in coordination with Indiana DNR biologists and interested public; C) Opening all
  areas to unlimited hunting and fishing, relying solely on applicable state and federal
  regulations; D) Utilize Refuge staff or other Fish and Wildlife Service personnel
  to achieve desired wildlife population levels. Alternative B is the preferred alternative.\",\n\t\"license_title\":
